 shall hear when I\u2019ve leisure to speak it. But the Snark is at hand, let me tell you again! \u2019Tis your glorious duty to seek it! \u201CTo seek it with thimbles, to seek it with care; To pursue it with forks and hope; To threaten its life with a railway-share; To charm it with smiles and soap! \u201CFor the Snark\u2019s a peculiar creature, that won\u2019t Be caught in a commonplace way. Do all that you know, and try all that you don\u2019t: Not a chance must be wasted to-day! \u201CFor England expects--I forbear to proceed: \u2019Tis a maxim tremendous, but trite: And you\u2019d best be unpacking the things that you need To rig yourselves out for the fight.\u201D Then the Banker endorsed a blank cheque (which he crossed), And changed his loose silver for notes. The Baker with care combed his whiskers and hair, And shook the dust out of his coats. The Boots and the Broker were sharpening a spade-- Each working the grindstone in turn: But the Beaver went on making lace, and displayed No interest in the concern: Though the Barrister tried to appeal to its pride, And vainly proceeded to cite A number of cases, in which making laces Had been proved an infringement of right. The maker of Bonnets ferociously planned A novel arrangement of bows: While the Billiard-marker with quivering hand Was chalking the tip of his nose. But the Butcher turned nervous, and dressed himself fine, With yellow kid gloves and a ruff-- Said he felt it exactly like going to dine, Which the Bellman declared was all \u201Cstuff.\u201D \u201CIntroduce me, now there\u2019s a good fellow,\u201D he said, \u201CIf we happen to meet it together!\u201D And the Bellman, sagaciously nodding his head, Said \u201CThat must depend on the weather.\u201D The Beaver went simply galumphing about, At seeing the Butcher so shy: And even the Baker, though stupid and stout, Made an effort to wink with one eye. \u201CBe a man!\u201D said the Bellman in wrath, as he heard The Butcher beginning to sob. \u201CS
